/**
 * 42. Trapping Rain Water
Hard
Topics
premium lock iconCompanies

Given n non-negative integers representing an elevation map where the width of each bar is 1, compute how much water it can trap after raining.

 

Example 1:

Input: height = [0,1,0,2,1,0,1,3,2,1,2,1]
Output: 6
Explanation: The above elevation map (black section) is represented by array [0,1,0,2,1,0,1,3,2,1,2,1]. In this case, 6 units of rain water (blue section) are being trapped.

Example 2:

Input: height = [4,2,0,3,2,5]
Output: 9

 */

function trapBrute(height: number[]): number {
    let sum = 0

    for (let i = 0; i < height.length; i++) {
        const maxL = Math.max(...height.slice(0,i))
        const maxR = Math.max(...height.slice(i))
        const minHeight = Math.min(maxL, maxR)

        if (minHeight > height[i]) {
            
            sum += minHeight - height[i]
        }
    }    
    
    return sum
};

function trap2(height: number[]): number {
    let sum = 0
    let maxL = height[0]

    for (let i = 0; i < height.length; i++) {

        maxL = Math.max(maxL, height[i])
        
        const maxR = Math.max(...height.slice(i))
        const minHeight = Math.min(maxL, maxR)

        if (minHeight > height[i]) {
            
            sum += minHeight - height[i]
        }
    }    
    
    return sum
};

function trap(height: number[]): number {
    let sum = 0
    let maxL = [height[0]]
    let maxR = [height[height.length-1]]

    for (let i = 1; i < height.length; i++) {
        maxL.push(Math.max(maxL[i-1], height[i]))
    }

    for (let i = height.length-2; i >= 0; i--) {
        maxR.unshift(Math.max(maxR[0], height[i]))
    }    

    for (let i = 0; i < height.length; i++) {
        const minHeight = Math.min(maxL[i], maxR[i])

        if (minHeight > height[i]) {
            sum += minHeight - height[i]
        }
    }    
    
    return sum
};


